  [],\n\t\"num_tags\": 0,\n\t\"name\": \"h11997outline-outline-of-the-bathymetric-data-collected-during-national-oceanic-and-atmospheric\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Geological Survey (USGS), in cooperation
  with the National Oceanic and Atmospheric Administration (NOAA), is producing detailed
  geologic maps of the coastal sea floor. Bathymetry and sidescan-sonar imagery, originally
  collected by NOAA for charting purposes, provides a fundamental framework for research
  and management activities in Long Island Sound, shows the composition and terrain
  of the seabed, and provides information on sediment transport and benthic habitat.
  During October 2008 NOAA completed hydrographic survey H11997 offshore in eastern
  Long Island Sound, and during May 2010 bottom photographs and surficial sediment
  data were acquired as part of a ground-truth reconnaissance survey of this area.
  Two interpretive data layers were derived from the multibeam echo-sounder and the
  ground-truth data used to verify them. For more information on the ground-truth
  survey see http://quashnet.er.usgs.gov/data/2010/10015/\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
